import React, { useState } from "react";
import styles from "./Deep.module.css";
import { faRightFromBracket } from "@fortawesome/free-solid-svg-icons";

const Deep = () => {
  const [mouseIn, setMouseIn] = useState(false);
  const [hedisOpen, setHedisOpen] = useState(false);
  const [feeScheduleOpen, setFeeScheduleOpen] = useState(false);
  const handleMouseOver = () => {
    setMouseIn(true);
  };

  const reset = () => {
    setMouseIn(false);
  };
  const toggleHedis = () => {
    setHedisOpen(!hedisOpen);
    // Toggle Fee Schedule state
    setFeeScheduleOpen(false);
  };

  const toggleFeeSchedule = () => {
    setFeeScheduleOpen(!feeScheduleOpen);
    // Close Hedis if open
    setHedisOpen(false);
  };

  return (
    <nav
      className={`${styles["deep-nav"]} ${styles["deep-body"]}`}
      onMouseOver={handleMouseOver}
      onMouseOut={reset}
    >
      <menu className={styles["deep-menu"]}>
        <li className={styles["deep-menuitem"]} id="demo1">
          <menu className={styles["deep-menu"]}>
            <li>
              <a>Deep Dive Session</a>
            </li>
            <li className={styles["deep-menuitem"]} id="demo2">
              <a onClick={toggleHedis}>Hedis</a>

              <menu className={styles["deep-menu"]}>
                <li className={styles["deep-menuitem"]} id="demo3">
                  <menu className={styles["deep-menu"]} >
                    <li st>
                      <a>Hedis Kt(Day 1)</a>
                    </li>
                    <li>
                      <a>Hedis Kt(Day 2)</a>
                    </li>
                    <li>
                      <a>Hedis Kt(Day 3)</a>
                    </li>
                    <li>
                      <a>Hedis Kt(Day 4)</a>
                    </li>
                    <li>
                      <a>Hedis Kt(Day 5)</a>
                    </li>
                    <li>
                      <a>Hedis Kt(Day 6)</a>
                    </li>
                    <li>
                      <a>Hedis Kt(Day 7)</a>
                    </li>
                    <li>
                      <a>Hedis Kt(Day 8)</a>
                    </li>
                    <li>
                      <a>Hedis Kt(Day 9)</a>
                    </li>
                  </menu>
                </li>
              </menu>
            </li>
            {/* <li className={`${styles['deep-menuitem']} ${styles['custom-margin']}`} id="demo4">
              <a>Fee Schedule</a>
              <menu className={styles['deep-menu']}>
                <li className={styles['deep-menuitem']} id="demo5">
                  <menu className={styles['deep-menu']}>
                    <li><a>Hedis Kt(Day 1)</a></li>
                    <li><a>Hedis Kt(Day 9)</a></li>
                  </menu>
                </li>
              </menu>
            </li> */}
            <li
              className={`${styles["deep-menuitem"]} ${styles["custom-margin"]}`}
              id="demo4"
            >
              <a onClick={toggleFeeSchedule}>Fee Schedule</a>
              {/* Display Fee Schedule files only when feeScheduleOpen is true AND hedisOpen is false */}
              {feeScheduleOpen && !hedisOpen && (
                <menu className={styles["deep-menu"]}>
                  <li className={styles["deep-menuitem"]} id="demo5">
                    <menu className={styles["deep-menu"]}>
                      <li>
                        <a>Kt (Day 1)</a>
                      </li>
                    </menu>
                  </li>
                </menu>
              )}
            </li>
            <li
              className={`${styles["deep-menuitem"]} ${styles["custom-margin1"]} ` }
              id="demo4"
            >
              <a onClick={toggleFeeSchedule} style={{ width: "250px"}}>Analytical Enablement </a>
             
                <menu className={styles["deep-menu"]}>
                  <li className={styles["deep-menuitem"]} id="demo5">
                    <menu className={styles["deep-menu"]}>
                      <li>
                        <a>Kt (Day 1) </a>
                      </li>
                    </menu>
                  </li>
                </menu>
            
            </li>
            
            <li
              className={`${styles["deep-menuitem"]} ${styles["custom-margin2"]} ` }
              id="demo4"
            >
              <a onClick={toggleFeeSchedule} style={{ width: "290px"}}>EDI CMS Defacto and Astrata </a>
         
              
                <menu className={styles["deep-menu"]}>
                  <li className={styles["deep-menuitem"]} id="demo5">
                    <menu className={styles["deep-menu"]}>
                      <li>
                        <a style={{ width: "260px"}}>CMS Defacto and Astrata </a>
                      </li>
                      <li>
                        <a style={{ width: "260px"}}>EDI (Data Migration)</a>
                      </li>
                    </menu>
                  </li>
                </menu>
              
            </li>
          </menu>
        </li>
      </menu>
    </nav>
  );
};

export default Deep;
